INSERT INTO `orte` VALUES (1,'Freiluftmuseum Gamla Linköping','Tunnbindaregatan 8, 582 46 Linköping','Linköping','Östergötlands län','Kultur','Im Freiluftmuseum Gamla Linköping, welches aus 90 Gebäuden besteht, können Sie die Atmosphäre aus früheren Zeiten regelrecht spüren. ','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/Friluftsmuseet_Gamla_Linkoping.png','58.405413, 15.588724'),(2,'Vrinnevi Mini Golf','Sprängstensgatan, 603 79 Norrköping  ','Norrköping','Östergötlands län','Aktivitäten','Der Minigolfplatz bietet Ihnen 18 verschiedene Einlochmöglichkeiten. ','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/Vrinnevi_Mini_Golf.png','58.571035, 16.183101'),(3,'Freddys Bar & Restaurant','Morabergsvägen 2, 152 42 Södertälje ','Södertälje','Stockholms län','Essen','In Freddys Bar und Restaurant werden leckere Hamburger, aber auch Gegrilltes angeboten. Das Frühstück ist auch besonders zu empfehlen.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/FreddysBarRestaurang.png','59.206376, 17.647403'),(4,'Södertälje Badeclub','Mälarbadet,151 89 Södertälje ','Södertälje','Stockholms län','Aktivitäten','Hier ist ein großer Schwimmbereich in schönster Natur. Hier kann man Volleyball spielen, oder auch ein leckeres Wassereis in der Sonne genießen. ','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/SodertaljeBatklubb.png','59.191266, 17.625017'),(5,'Tom Tits Experiment','Storgatan 33, 151 36 Södertälje   ','Södertalje','Stockholms län ','Kultur','Tom Tits Experiment ist ein Riesenhaus voller Experimente aus Physik, Natur und Wissenschaft, das Alt und Jung Möglichkeiten bietet neue Dinge zu lernen.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/TomTitsExperimentABSodertaljeCentrum.png','59.200402, 17.623737'),(6,'Vindeus Hotels','Klockarvägen 112,151 61 Södertälje ','Södertalje','Stockholms län ','Übernachtung','Alle Zimmer im Vindeus verfügen über einen Flachbild-TV, einen Kleiderschrank und Holzböden. Die  meisten bieten zudem ein eigenes Bad mit Dusche. Einige verfügen über eine eigene Küchenzeile. Das Frühstück wird Ihnen jeden Morgen im Speiseraum des Videus serviert.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/VindeusHotels.png','59.196137, 17.575520'),(7,'Restaurant St. George','Repslagaregatan 5, 602 25 Norrköping ','Norrköping ','Östergötlands län','Essen','St. George ist das einzige Restaurant in Norrköping, welches Spezialitäten auf einem syrischen Steinofen zubereitet.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/RestaurangStGeorge.png','58.588898, 16.188594'),(8,'The Lamp Hotel','Hospitalsgatan 5, 602 27 Norrköping','Norrköping','Östergötlands län','Übernachtung','Dieses Boutique-Hotel begrüßt Sie in einem renovierten Gebäude aus dem 18. Jahrhundert. Zudem hat es einen Feng-Shui-Garten und besitzt Schwedens größte Standleuchte. Hier genießen Sie schwedische Gerichte, die mit frischen Zutaten aus der Region zubereitet werden. Im Sommer können Sie auch auf der Terrasse im Freien speisen.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/TheLampHotel.png','58.591058, 16.187516'),(9,'Norrköpings Segelflugzeugclub','Slakthusvägen 8, 605 92 Norrköping ','Norrköping','Östergötlands län','Aktivitäten','Bei Nörrköpings Segelflugclub können sie mit routinierten Fliegern einen Segelflug erleben und die schöne Landschaft Schwedens von oben betrachten.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/NorrkopingsSegelflygklubb.png','58.592241, 16.239567'),(10,'Holmens Museum','Laxholmen, 602 21 Norrköping ','Norrköping ','Östergötlands län','Kultur','Hier sind die historischen Stadien der Papierherstellung von Handarbeit bis hin zu den Maschinen zu erkunden.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/HolmensMuseum.png','58.590845, 16.180825'),(11,'Tropicarium AB','Kopparbovägen 1, 618 93 Kolmården','Norrköping','Östergötlands län ','Aktivitäten','Hier lassen sich Tiere aus dem Wasser, dem Jungle und der Savanne beobachten. ','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/TropicariumAB.png','58.665768, 16.466956'),(12,'Sigtuna Museum','Södergatan 20, 195 47 Märsta','Sigtuna','Stockholms län','Kultur','In diesem Museum lässt sich Kunst auf kleinster Ausstellungsfläche besichtigen und bewundern.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/SigtunaMuseum.png','59.626092, 17.859772'),(13,'Freikirche der Zeugen Jehovas','Östra Galaxvägen 3,195 56 Märsta','Sigtuna','Stockholms län','Kultur','Einer der wenigen Zusammenkunftsorte der Zeugen Jehovas in Schweden. ','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/FrikyrkaJehovasVittnen.png','59.613715, 17.820875'),(14,'Kirche','Madängsvägen 32, 522 91 Tidaholm ','Tidaholm','Västra Götalands län','Kultur','Diese Kirche ist ein lohnendes Ziel für eine Besichtigung, das jeden Kirchengänger erfreuen wird.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/Kirche.png','58.135796, 13.928880'),(15,'Stinsen Arena','Rådhusgatan 28, 571 31 Nässjö ','Nässjö','Jönköpings län','Aktivitäten','In dieser Arena können Sie Ihr Können auf dem Eis zur Schau stellen. Sie bietet wunderbare große Eisflächen, die das Schlittschuhfahren zu einem echten Erlebnis machen.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/StinsenArena.png','57.653583, 14.697247'),(16,'Söderhällgården Kunsthandwerksmuseum','Tomtevägen 1, 814 94 Älvkarleby  ','Älvkarleby  ','Uppsala län ','Kultur','In diesem Volksmuseum mit Traditionen der Handwerkskunst können Sie in das Leben und die Vergangenheit der Einheimischen förmlich abtauchen.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/SoderhallgardenKonsthantverkMuseum.png','60.535426, 17.405092'),(17,'Landesmuseum Gävleborg','Södra Strandgatan 20, 802 50 Gävle ','Gävle','Gävleborgs län','Kultur','Das Landesmuseum von Gävleborg stellt Aspekte der Kultur- und Baugeschichte, traditionelle Gebäude, Landschaftsschutz und Archäologie dar.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/LansmuseetGavleborg.png','60.673922, 17.149968'),(18,'Norrsundets Arbeitermuseum','Kvistholmsvägen 5, 817 30 Norrsundet','Gävle','Gävleborgs län','Kultur','Lernen Sie das Leben von schwedischen Holzarbeitern kennen und entdecken sie die gute einheimische Küche von Gävle.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/NorrsundetsArbetarmuseum.png','60.926866, 17.140447'),(19,'Stockholms Fallschirmclub','Korsbo, 815 91 Tierp','Tierp','Uppsala län ','Aktivitäten','Lust auf etwas was das Blut in Wallung bringt? Dann versuchen Sie es doch mit einem Fallschirmsprung von ganz oben.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/StockholmsFallskarmsklubb.png','60.307923, 17.361505'),(20,'Bashkir Reitclub','Karlsäter 2, 814 95 Älvkarleby','Älvkarleby','Uppsala län','Aktivitäten','Ob ein spannender nächtlicher Ausritt durch die schwedische Natur, oder einfach nur ein gemütlicher erster Ritt: die Tour durch Wald und Wiesen zu Pferd wird aufregend.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/BashkirTurridning.png','60.492089, 17.469465'),(21,'Gävle Pistolenclub','Älgsjön, 805 92 Gävle ','Gävle','Gävleborgs län','Aktivitäten','Der Schießclub in Gävle bietet Unerfahrenen die das Schießen kennenlernen möchten die Möglichkeit dieses ungewöhnliche Hobby für sich zu entdecken.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/GavlePistolskytteklubb.png','60.617256, 17.233419'),(22,'Gefle Segelclub','Huseliiharen, 805 95 Gävle ','Gävle','Gävleborgs län','Aktivitäten','Hier können Sie eine schöne Segeltour machen und die Natur Schwedens genießen. ','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/GefleSegelSallskap.png','60.728748, 17.283937'),(24,'Freiluftmuseum Hägnan','Gamla Hamngatan 21,954 33 Gammelstad','Luleå  ','Norrbottens län','Kultur','Das Museum verfügt über Gebäude aus dem 18. und 19. Jahrhundert, die Besucher in eine andere Zeit von Luleå abtauchen lässt.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/FriluftsmuseetHagnan.png','65.649205, 22.036004'),(25,'Eishotel','Marknadsvägen 63, 981 91 Jukkasjärvi','Kiruna','Norrbottens län','Übernachtung','Ein Hotel, komplett aus Eis und Schnee erbaut, für die, die auf ein kleines Abenteuer aus sind.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/Icehotel.png','67.850961, 20.595426'),(26,'Margaretas Wirtshaus','Lulevägen 2, 954 33 Gammelstad','Luleå  ','Norrbottens län','Essen','Hier kann man in entspannter Runde in heimeliger Atmosphäre heißen Kaffee und kleine Spezialitäten genießen.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/MargaretasVardshus.png','65.644756, 22.029569'),(27,'Restaurant Roma','Östra Järnvägsgatan 8, 911 32 Vännäs ','Vännäs ','Västerbottens län','Essen','Bietet eine angenehme Atmosphäre und italienische Spezialitäten an.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/RestaurangRoma.png','63.905724, 19.752459'),(28,'Hildes Café ','Köpmangatan 13, 826 30 Söderhamn','Söderhamn','Gävleborgs län','Essen','Bietet eine einheimische Atmosphäre und kleine Spezialitäten an. Gut um in Kontakt mit Einheimischen zu kommen.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/HildesCafeAB.png','61.302937, 17.056190'),(29,'Petrigården','Församlingsvägen 12,954 33 Gammelstad','Luleå  ','Norrbottens län ','Kultur','Hier findet sich ein Ort der Anbetung in der Natur.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/Petrigarden.png','65.644508, 22.028802'),(30,'Elite Stadthotel Luleå','Storgatan 15, 97232 Luleå ','Luleå  ','Norrbottens län ','Übernachtung','Alle Zimmer im Elite Stadthotel Luleå sind individuell eingerichtet und umfassen eine Minibar, einen Schreibtisch und einen Flachbild-TV. Die Badezimmer sind mit italienischem Marmor ausgestattet. Neben dem kostenfreien Zugang zum Fitnessraum profitieren Sie während Ihres Aufenthalts auch von Gruppenkursen, an denen Sie zu ermäßigten Preisen teilnehmen können.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/EliteStadshotelletLulea.png','65.583809, 22.145985'),(31,'Comfort Hotel Jönköping','Klostergatan 28, 553 17 Jönköping','Jönköping','Jönköpings län','Übernachtung','Das hauseigene Restaurant serviert Ihnen schwedische und internationale Gerichte, gerne auch auf der sonnigen Terrasse. Nutzen Sie den Computer mit Internet in der Lobby, verweilen Sie an der Bar oder spielen Sie eine Partie Billard. Darüber hinaus genießen Sie kostenfreien Eintritt in einem nahe gelegenen Fitnessstudio.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/ComfortHotelJonkoping.png','57.779110, 14.156287'),(32,'BEST WESTERN Hotel Linköping','Hantverkaregatan 1, 582 23 Linköping ','Linköping','Östergötlands län','Übernachtung','Dieses zentral gelegene Hotel befindet sich neben dem mittelalterlichen Hauptplatz von Linköping. Das hauseigene Restaurant und die Bar servieren spanische Küche und Cocktails. Mehrere Restaurants und Pubs von Linköping befinden sich ebenfalls in der Nähe.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/BESTWESTERNHotelLinkoping.png','58.411468, 15.621940'),(33,'Scandic Hotel Norrköping City','Slottsgatan 99, 602 22 Norrköping   ','Norrköping','Östergötlands län','Übernachtung','Im hauseigenen Restaurant mit Bar genießen Sie schwedische Spezialitäten und internationale Gerichte. Ein Computer mit kostenfreiem Internetzugang sowie ein kleiner Laden, in dem Sie Getränke, Snacks und Pflegeprodukte erwerben können, sorgen in der Lobby für einen angenehmen Aufenthalt. Fahrräder leihen Sie in der Unterkunft kostenfrei aus.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/ScandicHotelNorrkopingCity.png','58.595129, 16.185986'),(34,'Hotel Paradis Södertälje Centrum ','Paradisgränd 2, 151 36  Södertälje ','Södertalje','Stockholms län','Übernachtung','Hier ist ein Apartment Komplex im Zentrum von Södertalje, der die Möglichkeit bietet verschiedene Apartments für eine bestimmte Zeit zu mieten.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/HotellParadisSodertaljeCentrum.png','59.200000, 17.626674'),(35,'Elite Eden Park Hotel','Sturegatan 22, 114 36 Stockholm    ','Stockholm','Stockholms län','Übernachtung','Das asiatisch inspirierte Restaurant im Elite Park wird von Melker Andersson geführt, einem der renommiertesten Köche Schwedens. Das Pub \"Bishops Arms\" bietet Ihnen sättigende Kneipengerichte und eine große Auswahl an Bieren und Whiskys.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/EliteEdenParkHotel.png','59.338678, 18.075029'),(36,'Quality Airport Hotel','Cederströms Slinga 2, 195 95 Arlandastad','Sigtuna','Stockholms län','Übernachtung','Die Quality Airport Hotels begrüßen Sie in Kochi und bietet Ihnen einen Außenpool und ein Fitnesscenter. Die Quality Airport Hotels bietet Ihnen auch eine 24-Stunden-Rezeption und eine Bibliothek.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/QualityAirportHotel.png','59.607901, 17.898520'),(37,'Hotel Uppsala (Uppsala Centrum) ','Kungsgatan 27, 753 21 Uppsala ','Uppsala','Uppsala län','Übernachtung','Hotel mitten in Zentrum von Uppsala. Bieten einen guten Service der das Hotel besonders heimisch macht, die zentrale Lage ist perfekt um die Stadt zu erkunden.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/HotelUppsalaUppsalaCentrum.png','59.861811, 17.638008'),(38,'Schwedisches Chinatown in Älvkarleby','Sveavägen 25, 815 40 Tierp','Tierp','Uppsala län ','Übernachtung','Das ist ein Hotel im chinesischen Stil, das Kunstwerke und Skulpturen aus China zum Betrachten ausstellt.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/SwedishChinatowninAlvkarlebyAB.png','60.347370, 17.512110'),(39,'BEST WESTERN Hotel City Gävle','Nygatan 8, 803 20 Gävle ','Gävle','Gävleborgs län','Übernachtung','Alle Zimmer im Hotel City Gävle verfügen über Parkettböden, einen Schreibtisch und ein eigenes Bad mit Dusche. Im HC Bar & Restaurant genießen Sie Mittag- und Abendessen sowie traditionelle schwedische Gerichte à la carte. Das Frühstücksbuffet mit lokalen Bio-Optionen wird Ihnen ebenfalls in diesem geräumigen Restaurant serviert.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/BESTWESTERNHotelCityGavle.png','60.673935, 17.137875'),(40,'Hotel Temperance i Hudiksvall','Håstagatan 16, 824 43 Hudiksvall ','Hudiksvall','Gävleborgs län','Übernachtung','Ausgestattet mit kostenlosem WiFi im gesamten Gebäude bietet das Hotel Temperance Unterkunft in Hudiksvall, 300 Meter vom Museum der Hälsingland.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/HotellTemperanceiHudiksvallAB.png','61.725372, 17.105765'),(41,'Panget Hotel & Restaurant','Sörbyvägen 27, 891 61 Örnsköldsvik  ','Örnsköldsvik','Västernorrlands län','Übernachtung, Essen','Das Pagnet Hotel ist ein schlichtes kleine Unterkunft in der man sich schnell heimisch vorkommt und auch nahe an das Lebensgefühl der Einheimischen heran kommt.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/PangetHotellRestaurang.png','63.286761, 18.744261'),(42,'BEST WESTERN Hotel Botnia Teg ','Norra Obbolavägen 125, 904 22 Umeå','Umeå','Västernorrlands län','Übernachtung','Mit Blick auf den Fluss Ume empfängt Sie dieses umweltfreundliche Hotel. Im Botnia wird jeden Abend ein Buffet serviert. Auf der Speisekarte finden Sie zudem Rentier, Elch und andere regionale Spezialitäten.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/BESTWESTERNHotelBotniaTeg.png','63.802540, 20.280128'),(43,'Clarion Hotel Sense','Skeppsbrogatan 34, 972 32 Luleå    ','Luleå ','Norrbottens län','Übernachtung','Jedes Zimmer ist mit einzigartiger Fotokunst und Designermöbeln ausgestattet. Das hoteleigene À-la-carte-Restaurant Kitchen & Table hat von Montag bis Samstag zum Abendessen geöffnet.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/ClarionHotelSense.png','65.584845, 22.152537'),(44,'Stallmästaregården','113 47 Stockholm ','Stockholm','Stockholms län ','Wandern','Diese Umgebung bietet idyllische Wanderwege in malerischer Natur. ','http://p3reise.schwarzes-seelenreich.de:8080/ass