124, 962 23 Jokkmokk ','Jokkmokk','Norrbottens län','Wandern','Wer das Wandern durch einen Nationalpark mit Bäumen und Bergen, sowie das Spazierengehen neben Waldbächen mag, ist hier richtig.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/NationalparkMuddus.png','66.604856, 19.834285'),(52,'Neue Kirche Gällivare','Lasarettsgatan 10,982 31 Gällivare ','Gällivare','Norrbottens län','Kultur','Eine Kirche die im 19 Jahrhundert gebaut wurde, hier geht das Herz von Kirchenliebhabern auf.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/The_new_church_in_Gallivare.png','67.132797, 20.658259'),(53,'Jönköpings Kanuclub','V-Strandpromenaden, Box 101, 551 13 Jönköping','Jönköping','Jönköpings län','Aktivitäten','Wer Kanu fahren schon immer mal ausprobieren wollte kann hier eine Fahrt wagen und die wunderschöne Natur Schwedens vom Wasser aus betrachten.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/Jonkopings_Kanotklubb.png','57.788971, 14.150323'),(54,'Jönköpings Stadtpark','551 89 Jönköping  ','Jönköping','Jönköpings län','Wandern','Wer Lust auf einen Spaziergang mit Lerneffekt hat, ist hier im Park richtig. Hier kann man sich in das Leben der Einheimischen mischen und ist direkt im Mittelpunkt der Gesellschaft mit dabei.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/Jonkopings_Stadspark.png','57.783932, 14.161650'),(55,'Liljeholmspark','554 53 Jönköping ','Jönköping','Jönköpings län','Wandern','Bietet eine schöne Umgebung für Spaziergänge und Walken. ','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/Liljeholmsparken.png','57.783365, 14.214060'),(56,'Burg Brahehus','563 91 Gränna','Gränna','Jönköpings län','Wandern','Wandern mit einer Kultureinlage wird hier geboten. Das Highlight ist die Burgruine die auf dem Wanderweg liegt und ein wundervolles Motiv für Fotos bildet.','http://p3reise.schwarzes-seelenreich.de:8080/assets/img/Burg_Brahehus.png','58.050906, 14.536774'),(57,'Vättern Kajak','Lievägen 3, 599 31 Ödeshög ','Ödes